import React from "react";
import logo from './../logo.svg';
import Topbar from "./Topbar";
import MiddleSection from "./MiddleSection";
import Footer from "./Footer";
import { RouteFiles } from "../Routes/RouteFiles";


function Layout(){
return(
    <>
    <div className=" ">
      <div
       className=" ">
       <Topbar/>
      </div> 
      <div className=" ">
      <RouteFiles />
      </div>
      <div className=" ">
      <Footer/>
      </div>
    </div>
      
   
    
    </>
);
}
export default Layout;
